import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Switch,
  Link,
} from "react-router-dom";
import Navigation from "./Navigation";

function App() {
  return (
    <Router>
      <Navigation />

      <Routes>
        <Route exact path="/"></Route>
      </Routes>
    </Router>
  );
}

export default App;
